# Local Handlers - direct methods and instances

def get_fake_result(x):
    """
    The fake data is an encoded string previously saved of an RGB file
    screenshot of a Vespa-Analysis results layout. 

    """
    if x == 0:
        # these steps decode the original encoded list of ints 
        data = base64.b64decode(test1)
        data = zlib.decompress(data)
        p = xdrlib.Unpacker(data)
        data = p.unpack_farray(len(data) // 4, p.unpack_int)     # 4 since we expect INT32 here 
    else:
        data = [0,] * (512*512*3)

    return data
    

                  
def do_process(dim0, ncoil, nfids_wat, nfids_met, sw, freq, seqte, nucstr, seqstr, data, 
                  fpreset, fname_rgb_out='', fname_out='', verbose=False):

    '''
    data     ndarray with dimensions [ncoil,nfids,dim0], dtype=np.complex128
    
    '''


    if verbose: print("currently running: vespa_process_ge() ")

    print('In method vespa_process_ge')
    print('seqstr = '+str(seqstr))


    # Set up header info ----------------------------------------

    d = { }
    d["header"] = "Vespa Inline GE - vespa_process_ge()"
    d["sw"]             = float(sw)
    d["sequence_type"]  = seqstr
    d["frequency"]      = float(freq)
    d["dims"]           = DataRawFidsum.DEFAULT_DIMS
    d["dims"][0]        = int(dim0) 
    d["dims"][1]        = int(nfids_wat+nfids_met)
    d["dims"][2]        = int(ncoil)
    d["dims"][3]        = 1 
    d["seqte"]          = float(seqte)     # comes in as msec
    d["nucleus"]        = nucstr
    if nucstr == '1H':
        d["resppm"] = constants.DEFAULT_PROTON_CENTER_PPM
    else:
        print("X-nuclei detected in data parsing, returning.")
        return
 

    #-------------------------------
    # Water Dataset

    dims        = d["dims"]
    dim0        = dims[0]
    ncoils      = dims[2]
    nfids       = nfids_wat
    acqdim0     = dims[0] 

    scale       = 1.0  #RAWDATA_SCALE / float(nfids) 
    dat         = np.empty([ncoils,nfids,dim0], dtype=np.complex128)

    for i in range(nfids):
        for j in range(ncoils):
            tmp = data[j,i,:].copy() * scale                     # in pulseq acquisition order
            # tmp = np.conjugate(chan)
            dat[j,i,:] = tmp                # index coils on outside so eventually collapse to 1,1,nfid,dim0

    d["data"] = dat
    d["data_source"] = "Vespa Inline GE - vespa_process_ge() - water fids"
    d["dims"][1] = nfids_wat
    raw = DataRawFidsum(d)

    dataset = _import_ge([raw,], open_dataset=None)
    dataset_water = dataset[0]

    #-------------------------------
    # Metabs Dataset

    dims        = d["dims"]
    dim0        = dims[0]
    ncoils      = dims[2]
    nfids       = nfids_met
    acqdim0     = dims[0] 

    scale       = 1.0  #RAWDATA_SCALE / float(nfids) 
    dat         = np.empty([ncoils,nfids,dim0], dtype=np.complex128)

    for i in range(nfids):
        for j in range(ncoils):
            tmp = data[j,i+nfids_wat,:].copy() * scale                     # in pulseq acquisition order
            # tmp = np.conjugate(chan)
            dat[j,i,:] = tmp       # index coils on outside so eventually collapse to 1,1,nfid,dim0

    d["data"] = dat
    d["data_source"] = "Vespa Inline GE - vespa_process_ge() - metab fids"
    d["dims"][1] = nfids_met
    raw = DataRawFidsum(d)

    dataset = _import_ge([raw,], open_dataset=None)
    dataset = dataset[0]

    # Import preset file --------------------------------------------
    preset = _import_preset(fpreset)

    # Update dataset with preset ------------------------------------
    dataset.apply_preset(preset, voxel=(0,0,0))

    # Process and fit data ------------------------------------------
    chain_outputs = _process_all_blocks(dataset)

    # Save results to xml if requested ------------------------------
    
    if fname_out:
        dataset.dataset_filename = fname_out
        util_export.export(fname_out, [dataset], None, None, False)

    # Calc and Save visual results to RGB format --------------------

    timestamp = util_time.now(util_time.DISPLAY_TIMESTAMP_FORMAT)

    fig_call = figure_layouts.analysis_brp512
    fig = fig_call( dataset, 
                    viffpath='Analysis - GE Orchestra PySDK Inline', 
                    vespa_version='0.9.10i',
                    timestamp=timestamp,
                    fontname='Courier New',
                    minplot=0.1,
                    maxplot=4.9,
                    nobase=True,
                    extfig=None,
                    fixphase=True,
                    verbose=False, 
                    debug=False)

    buf1 = fig.canvas.tostring_rgb()

    # convert string to byte arry and write to a debug file
    cbuf = np.fromstring(buf1, dtype=np.uint8)
    
    if fname_rgb_out:
        print("Saving degug RGB file to - " + str(fname_rgb_out))
        cbuf.tofile(fname_rgb_out)
        fig.savefig(fname_rgb_out+'.png', dpi=300, pad_inches=0.5)



    print('finished vespa_process()')

    return cbuf   




def _process_all_blocks(dataset):
    """ for all voxels, run chain in all blocks to update """
    
    chain_outputs = {}
    
    try:
        voxel = dataset.all_voxels
        for key in list(dataset.blocks.keys()):
            if key == 'spectral':
                key = 'spectral'
                block = dataset.blocks[key]
                tmp = block.chain.run(voxel, entry='all')
                chain_outputs[key] = tmp
                
                print('block._svd_outputs = ', block.get_svd_output([0,0,0]))
                
                if 'fit' in list(dataset.blocks.keys()):
                    key = 'fit'
                    block = dataset.blocks[key]
                    block.chain.run(voxel, entry='initial_only')
                    key = 'spectral'
                    block = dataset.blocks[key]
                    block.set_do_fit(True, voxel[0])
                    tmp = block.chain.run(voxel, entry='all')
                    chain_outputs[key] = tmp
            else:
                block = dataset.blocks[key]
                tmp = block.chain.run(voxel, entry='all')
                chain_outputs[key] = tmp
    except Exception as e:
        print(str(e)) 
        

    return chain_outputs
    

def _import_preset(presetfile):

    try:
        msg = ""
        try:
            importer = util_import.DatasetImporter(presetfile)
        except Exception as e:
            msg = str(e)
            print(str(e)) 
        
        # except IOError:
        #     msg = """I can't read the preset file "%s".""" % presetfile
        # except SyntaxError:
        #     msg = """The preset file "%s" isn't valid Vespa Interchange File Format.""" % presetfile

        if msg:
            print(msg)
        else:
            # Time to rock and roll!
            presets = importer.go()
            preset  = presets[0]
            
            return preset

    except Exception as e:
        print(str(e)) 
            
    
def _import_ge(raws, open_dataset=None):
    """
    Stolen from Analysis main.py module - trimmed for CLI usage
    
    Assumption here is that we are opening one file in the reader. If there is
    an 'open_dataset' sent in, then the current reader is for an associated 
    file. We will associate the current file with the open one at the end of
    the code.
    
    """
    datasets = [ ]

    # Convert these raw objects into fully-fledged dataset objects.
    if open_dataset:
        zero_fill_multiplier = open_dataset.zero_fill_multiplier
    else:
        zero_fill_multiplier = 0

    # Step 2
    #
    # See if any data types need special classes. We usually only
    # look for raw fidsum classes which trigger a prep fidsum block.
    block_class_specs = []
    for raw in raws:
        d = { }
        if isinstance(raw, DataRawFidsum):
            d["prep"] = block_prep_fidsum.BlockPrepFidsum
        block_class_specs.append(d)

    f = lambda raw, block_classes: mrs_dataset.dataset_from_raw(raw, block_classes, zero_fill_multiplier)
    datasets = list(map(f, raws, block_class_specs))

    if datasets:

        if open_dataset is not None:
            open_dataset.blocks['raw'].set_associated_datasets([datasets[0], ])

        return datasets[0], open_dataset
    
    else:
        return None, open_dataset






