def _test(data_pfile=None):
    
    test_case = 0

    # r = imp.find_module("vespa_inline_ge")
    # fpath  = os.path.split(r[1])[0]+os.sep+'testdata'      

    r = os.path.dirname(os.path.abspath(__file__))
